import React from "react";
import { Helmet, HelmetProvider } from "react-helmet-async";
import { Container, Row, Col } from "react-bootstrap";
import Slider from "react-slick";
import "./style.css"; // Make sure to import your styles here

export const Portfolio = () => {
  const settings = {
    className: "center",
    centerMode: true,
    infinite: true,
    centerPadding: "60px",
    slidesToShow: 3,
    speed: 500
  };

  return (
      <HelmetProvider>
        <Container className="About-header">
          <Helmet>
            <meta charSet="utf-8" />
            <title> Portfolio | {meta.title} </title>{" "}
            <meta name="description" content={meta.description} />
          </Helmet>
          <Row className="mb-5 mt-3 pt-md-3">
            <Col lg="8">
              <h1 className="display-4 mb-4"> Мое портфолио </h1>{" "}
              <hr className="t_border my-4 ml-0 text-left" />
            </Col>
          </Row>
          <div className="mb-5 po_items_ho">
            <Slider {...settings}>
              <div className="po_item">
                <img src="https://i.ibb.co/mhXfWVd/sber.jpg" alt="" />
                <div className="content">
                  <p>Простой клон приложения сбербанка, написанный на Python с использованием библиотеки Customtkinter</p>
                  <a href="#">view project</a>
                </div>
              </div>
              {/* Add more items similarly */}
            </Slider>
          </div>
        </Container>
      </HelmetProvider>
  );
};
